if __name__ == "__main__":  # pragma: no cover
    import io
    import re
    import string
    from pathlib import Path

    import requests

    from mitmproxy.tools.console.common import SYMBOL_MARK

    CHAR_MARKERS = list(string.ascii_letters) + list(string.digits)
    EMOJI_SRC = '    ":{name}:": "{emoji_val}",'
    CHAR_SRC = '    "{name}": "{emoji_val}",'

    out = io.StringIO()

    r = requests.get("https://api.github.com/emojis")
    for name, url in r.json().items():
        codepoints = url.rpartition("/")[2].partition(".png")[0].split("-")
        try:
            emoji_val = "\u200d".join(chr(int(c, 16)) for c in codepoints)
        except ValueError:
            continue  # some GitHub-specific emojis, e.g. "atom".
        print(EMOJI_SRC.format(name=name, emoji_val=emoji_val), file=out)

    # add the default marker
    print(EMOJI_SRC.format(name="default", emoji_val=SYMBOL_MARK), file=out)

    for c in CHAR_MARKERS:
        print(CHAR_SRC.format(name=c, emoji_val=c), file=out)

    Path(__file__).write_text(
        re.sub(
            r"(?<={\n)[\s\S]*(?=}\n)",
            lambda x: out.getvalue(),
            Path(__file__).read_text("utf8"),
            1,
        ),
        "utf8",
    )
